import React from "react";

const Nav = () => {
  return (
    <div className="navbar">
      <div className="container">
        <a href="#">logo</a>
        <ul>
          <a href="/">Home</a>
          <a href="/about">About</a>
        </ul>
      </div>
    </div>
  );
};

export default Nav;
